function Todo(props) {
  return (
    <div className={"card"}>
      <h2>{props.text}</h2>
      <div className={"actions"}>
        <button className={"btn"} onClick={console()}>
          Delete
        </button>
      </div>
    </div>
  );
}

const console = () => {
  console.log("hello");
};

export default Todo;
